// 테스트용 데이터입니다.
const MeditationData = [
  {id: 1, title: 'First that i worte', desc: 'I felt like meditation is so hard..'},
  {id: 2, title: 'Second that i worte', desc: 'I can see breath that i am doing'},
  {id: 3, title: 'Third', desc: 'I had a lot of thoughts'}
]

export default MeditationData;
